function Form(props) {

    const [member, setMember] = useState({name: "", email: "", role: ""});

    const handleChanges = (event) => {

        setMember();
    }

    return(

        <form>
            <label htmlFor='name'>Name: </label>
            <input 
                id='name'
                name='name'
                type='text'
                placeholder='Full Name'
                required
            />
            <label>Email: </label>
            <input 
                id='email'
                name='email'
                type='text'
                placeholder='Email Address'
                required
            />
            <label>Role: </label>
            <input 
                id='role'
                name='role'
                type='text'
                placeholder='Role'
                required
            />
        </form>

    );
}

export default Form;
